import React from "react";
import style from "./keyboard.module.css";
import Display from "../display/display";
import { useState } from "react";


const KeyBoard = function (props) {
	const [displayValue, setDisplayValue] = useState("");

	function handleClick(value) {
	  // Asegúrate de que el valor tenga como máximo 4 dígitos
	  const updatedValue = (displayValue + value).slice(0, 4);
	  setDisplayValue(updatedValue);
	}
	function handleOk() {
		// Verifica si los cuatro dígitos son iguales a "0137"
		if (displayValue === "0137") {
		  alert("¡Código correcto!");
		  // Aquí puedes realizar las acciones que desees cuando el código sea correcto
		} else {
		  alert("Código incorrecto. Intenta de nuevo.");
		  // Aquí puedes realizar las acciones que desees cuando el código sea incorrecto
		}
		// Limpia el display después de la verificación
		setDisplayValue("");
	  }
	
	  function handleDelete() {
		// Borra el último dígito del display
		setDisplayValue(displayValue.slice(0, -1));
	  }

    return (
        <div>
				<Display value={displayValue} />
            <table >
				<tbody className={style.tdLine}>
			
					<tr className={style.tdLine}></tr><tr className={style.tdLine}></tr><tr className={style.tdLine}></tr>
				
					<tr className={style.tdLine}>
						<td className={style.tdLine}>  <button className={style.botonesStyle} onClick={() => handleClick("1")}>1</button></td>
						<td className={style.tdLine}>  <button className={style.botonesStyle} onClick={() => handleClick("2")}>2</button></td>
						<td className={style.tdLine}>  <button className={style.botonesStyle} onClick={() => handleClick("3")}>3</button></td>
					</tr>
					<tr className={style.tdLine}>
						<td className={style.tdLine}>  <button className={style.botonesStyle} onClick={() => handleClick("4")}>4</button></td>
						<td className={style.tdLine}>  <button className={style.botonesStyle} onClick={() => handleClick("5")}>5</button></td>
						<td className={style.tdLine}>  <button className={style.botonesStyle} onClick={() => handleClick("6")}>6</button></td>
					</tr>
					<tr className={style.tdLine}>
						<td className={style.tdLine}>  <button className={style.botonesStyle} onClick={() => handleClick("7")}>7</button></td>
						<td className={style.tdLine}>  <button className={style.botonesStyle} onClick={() => handleClick("8")}>8</button></td>
						<td className={style.tdLine}>  <button className={style.botonesStyle} onClick={() => handleClick("9")}>9</button></td>
					</tr>
					<tr className={style.tdLine}>
						<td className={style.tdLine}><button className={style.botonesStyle} onClick={() => handleDelete()}>←</button></td>
						<td className={style.tdLine}><button className={style.botonesStyle} onClick={() => handleClick("0")}>0</button></td>
						<td className={style.tdLine}><button className={style.botonesStyle} onClick={() => handleOk()}>√</button></td>
						<td></td>
					</tr>
				</tbody>
			</table>
        </div>
    );
};

export default KeyBoard;
